import React, { Component } from 'react';
import './App.css';
import net from 'net';

var HOST = '0.0.0.0';
var PORT = 5000;

var server = net.createServer(function (socket) {
  socket.on('data', function (data) {
    console.log(data.toString());
  })
})

server.listen(PORT, HOST);


class App extends Component {
  render() {
    return (
      <div className="App">

      </div>
    );
  }
}


export default App;
